import React, { memo } from 'react';
import {ItemSong} from './'
import icons from '../ultis/icon';

const ListSong = ({songs, totalDuration}) => {
    // console.log(songs, totalDuration)
    const {PiArrowsDownUpFill} = icons
    return (
        <div className='w-full flex flex-col'>
            <div className='flex  text-xs px-8 py-5 text-main-100 font-semibold border-b   border-b-[#ffffff0d]  rounded-[5px]'>
                <div className='flex justify-between w-full'>
                <span  className='flex-1'>
                    <span></span>BÀI HÁT</span>
                <span className='flex-1 flex justify-center'>ALBUM</span>
                <span className='flex-1 flex justify-end'>THỜI GIAN</span>
                </div>
            </div>

            
            <div className='flex flex-col'>
                {songs?.map(item =>(
                <ItemSong 
                key={item.encodeId}
                songData= {item}
                />
                ))}
            </div>
        </div>
    );
}

export default  memo(ListSong);
